from typing import List

class Solution:
    def numSubmat(self, mat: List[List[int]]) -> int:
        rows, cols = len(mat), len(mat[0])
        ans = 0
        for top in range(rows):
            height = [0] * cols
            for down in range(top, rows):
                for col in range(cols):
                    if mat[down][col] == 1:
                        height[col] += 1
                    else:
                        height[col] = 0
                count = 0
                for col in range(cols):
                    if height[col] == down - top + 1:
                        count += 1
                    else:
                        count = 0
                    ans += count
        return ans


